class Solution:
    def calculateMinimumHP(self, dungeon):
        """
        :type dungeon: List[List[int]]
        :rtype: int
        """
        if not dungeon:
            return 0
        if len(dungeon) == 1 and len(dungeon[0]) == 1:
            return 1
        if len(dungeon) == 1:
            return max(1, -dungeon[0][0])
        if len(dungeon[0]) == 1:
            return max(1, -dungeon[-1][-1])
        dp = [[0 for _ in range(len(dungeon[0]))] for _ in range(len(dungeon))]
        dp[0][0] = max(1, -dungeon[0][0])
        for i in range(1, len(dungeon)):
            dp[i][0] = max(1, -dungeon[i][0])
        for j in range(1, len(dungeon[0])):
            dp[0][j] = max(1, -dungeon[0][j])
        for i in range(1, len(dungeon)):
            for j in range(1, len(dungeon[0])):
                dp[i][j] = max(1, -dungeon[i][j])
                dp[i][j] = max(dp[i-1][j], dp[i][j-1])
                dp[i][j] += dp[i-1][j-1]
        return dp[-1][-1]

