from collections import deque


def solve(a, b):
    q = deque([(a, b)])
    seen = set()
    while q:
        a, b = q.popleft()
        if a == b:
            return True
        if (a, b) in seen:
            continue
        seen.add((a, b))
        for i in range(4):
            a1 = a[:i] + a[i+1:]
            b1 = b[:i] + b[i+1:]
            if a1 == 'X' and b1 == 'X':
                continue
            if a1 == 'X' and b1 != 'X':
                q.append((a1, b))
            elif a1 != 'X' and b1 == 'X':
                q.append((a, b1))
            elif a1 != 'X' and b1 != 'X':
                q.append((a1, b1))
    return False


